INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionMarkdown`, `descriptionHTML`, `image`, `createdAt`, `updatedAt`) VALUES
(2, 'Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội', 'Bệnh viện Hữu nghị Việt Đức', '\n## GIỚI THIỆU\n**Địa chỉ:**  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng: \n* Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\n\n**Thời gian làm việc:** Thứ 2 đến thứ 7\n* Sáng: 7h00 - 12h00\n* Chiều: 13h30 - 16h30\n\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. \n\nViệt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. \n\nBệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau. \n\n**Lưu ý quan trọng**\n* Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.\n* Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.\n* Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.\n\n**Chi phí khám**\n\nNgười bệnh có thể lựa chọn một trong các gói khám sau:\n\n1. Gói 1:\n   * Khám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám\n   * Khám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám\n2. Gói 2:\n   * Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám\n\n## THẾ MẠNH CHUYÊN MÔN\nBệnh viện Việt Đức là bệnh viện chuyên khoa Ngoại (phẫu thuật), có thế mạnh về khám, điều trị và Phẫu thuật nhiều chuyên khoa. Một số thế mạnh của Bệnh viện Việt Đức là:\n* Khám, điều trị, phẫu thuật về Thần kinh\n* Khám, điều trị, phẫu thuật về Cơ xương khớp\n* Khám, điều trị, phẫu thuật về Cột sống\n* Khám, điều trị, phẫu thuật về Tiêu hóa\n* Khám, điều trị, phẫu thuật về Gan mật\n* Khám, điều trị, phẫu thuật về Nam học\n\nLà bệnh viện đi đầu về Phẫu thuật ở nước ta, các bác sĩ đã thực hiện thành công rất nhiều ca phẫu thuật khó.\n* **Phẫu thuật tim mạch:** Mổ tim mở được tiến hành thường quy, tiến hành các kỹ thuật tim mạch khó, thay van tim, kỹ thuật Bentall, bắc cầu mạch vành, mổ nối mạch ở tim đang đập.\n* **Phẫu thuật Thần kinh:** Mổ chấn thương sọ não, bệnh ở não - tuỷ sống, mổ u tuyến yên qua xoang bướm, mổ u thần kinh VIII qua mê nhĩ có sử dụng dao siêu âm.\n* **Phẫu thuật Nội soi và nội soi can thiệp:** Các loại phẫu thuật nội soi ổ bụng cắt túi mật, cắt u tuyến thượng thận, cắt dây thần kinh X, u nang buồng trứng, cắt lách, cắt ruột thừa bằng nội soi an toàn, tai biến ít, giảm ngày điều trị, phục hồi sau mổ nhanh.\n* **Phẫu thuật gan mật tuỵ:** Cắt gan các loại do ung thư, bệnh gan mật và chấn thương; Các phẫu thuật về biến chứng chảy máu do xơ gan - tǎng áp lực tĩnh mạch cửa \n* **Phẫu thuật Chấn thương chỉnh hình:** Các loại chấn thương, thay khớp háng một bên hay toàn bộ, nội soi khớp.\n* **Phẫu thuật tiêu hoá:** Các kỹ thuật khó phức tạp như cắt bỏ và tạo hình thực quản, cắt khối tá tuỵ, cắt toàn bộ dạ dày, cắt đại tràng các loại.\n\n**Cụ thể, bệnh viện nhận khám các vấn đề về:**\n* Bệnh lý thần kinh\n* Nội - Hồi sức thần kinh\n* Bệnh tim mạch và lồng ngực\n* Phẫu thuật tim mạch - lồng ngực\n* Ngoại nhi và trẻ sơ sinh\n* Bệnh lý tiêu hóa\n* Phẫu thuật tiêu hóa\n* Bệnh cột sống/thoát vị đĩa đệm\n* Chi trên và y học  thể thao\n* Bệnh lý chi dưới\n* Khám xương và điều trị ngoại trú\n* Phẫu thuật chấn thương chung\n* Phẫu thuật tạo hình - hàm mặt - thẩm mỹ\n* Phục hồi chức năng\n* Nhiễm khuẩn\n* Phẫu thuật nhiễm khuẩn\n* Bệnh đường tiết niệu\n* Bệnh nam học/nam khoa\n* Bệnh lý gan mật\n* Ung bướu\n* Thận lọc máu\n* Bệnh lý hậu môn trực tràng\n* Trung tâm ghép tạng\n* Phòng khám Tai mũi họng\n\n## TRANG THIẾT BỊ\nBệnh viện Việt Đức được trang bị hầu hết các trang thiêt bị hiện đại hàng đầu hiện nay phục vụ trong chẩn đoán và thực hiện các xét nghiệm cơ bản, xét nghiệm kỹ thuật cao như các xét nghiệm theo dõi bệnh nhân ghép tạng, các xét nghiệm chỉ điểm khối u.\n* Xquang số hóa\n* Máy siêu âm\n* Máy chụp cắt lớp vi tính đa dãy CT Scan\n* Máy chụp cộng hưởng từ MRI 3.0 Tesla\n* Hệ thống chụp mạch máy chuyên dụng\n* Hệ thống PET/CT phát hiện ung thư sớm và đánh giá các bệnh lý tim mạch, thần kinh\n* Hệ thống máy sinh hóa miễn dịch tự động, máy sinh hóa tự động, máy xét nghiệm huyết học, xét nghiệm đông máu tự động…\n\nCác thiết bị thăm dò chức năng hỗ trợ thăm khám và thực hiện các thủ thuật nội soi tiêu hóa - gan mật.\n* Nội soi thực quản - dạ dày - tá tràng chẩn đoán\n* Nội soi đại trực tràng chẩn đoán\n* Nội soi đường mật - tụy ngược dòng ERCP\n* Siêu âm nội soi chẩn đoán bệnh lý thuộc cơ quan tiêu hóa, chọc hút tế bào\n* Nội soi can thiệp, nong hẹp đường tiêu hóa\n* Nội soi đặt stent khí quản, đặt sonde tá tràng\n* Nội soi can thiệp đại tràng.\n\n## VỊ TRÍ\nCác trang web khác ghi địa chỉ Bệnh viện Việt Đức ở 40 Tràng Thi, đây là cổng chính nhưng thông thường chỉ dành cho những công việc giấy tờ, hành chính. Bệnh nhân đến khám sẽ đi các cổng phụ trên đường Phủ Doãn. \n\nTrên đường Phủ Doãn có 3 cổng và đường Tràng Thi có 1 cổng chính. Người bệnh nên đi đúng cổng như chỉ dẫn để đi đến phòng khám dễ dàng, nhanh chóng nhất.\n\n![](https://cdn.bookingcare.vn/fo/2018/07/04/133335so-do-benh-vien-viet-duc.jpg)\n\n## QUY TRÌNH KHÁM\nDưới đây là Hướng dẫn làm thủ tục ưu tiên cho người bệnh đặt khám qua BookingCare tại Bệnh viện Hữu nghị Việt Đức.\n\n![](https://cdn.bookingcare.vn/fr/w800/2021/07/08/095133-quy-trinh-kham-khu-c4.png)\n\n**CỤ THỂ:**\n\n**1.** Bạn đến cổng số 16-18 Phủ Doãn\n\nVề nơi gửi xe:\n* Xe máy gửi tại bãi đỗ xe trước cửa bệnh viện (có nhân viên bảo vệ hướng dẫn).\n* Xe ô tô: Hiện tại Bệnh viện chưa có chỗ gửi xe ô tô riêng biệt, xe ô tô bạn có thể gửi tại Cung Văn hóa Hữu nghị Việt Xô, cách bệnh viện khoảng 500m. Nếu được, bạn nên đi taxi để thuận tiện hơn.\n\n![](https://cdn.bookingcare.vn/fo/2018/08/01/114926cong--so--1-benh-vien-viet-duc.jpg)\n\n2. Bạn đến Tòa nhà C4: Tòa nhà thứ 2 bên tay trái từ cổng vào số 16-18 Phủ Doãn.\n\n![](https://cdn.bookingcare.vn/fr/w800/2021/07/07/160715-c4-bv-viet-duc.jpg)\n\n3. Vào tầng 1, xếp hàng ở KHU VỰC ƯU TIÊN DÀNH CHO BỆNH NHÂN KHÁM THEO YÊU CẦU để lấy số ưu tiên nhanh nhất (xem thêm hình dưới).\n\n![](https://cdn.bookingcare.vn/fr/w800/2020/10/06/154540-c4-quay-uu-tien.jpg)\n\n* Đến **quầy số 01**, khi đến lượt vào báo đã Đặt lịch khám qua BOOKINGCARE (phiếu khám đã được in sẵn, người bệnh KHÔNG cần khai báo thêm).\n\n![](https://cdn.bookingcare.vn/fr/w800/2020/10/06/162248-quay-dang-ki-uu-tien-1.jpg)\n\n**4.** Bạn sẽ nhận được phiếu khám **có dán tem ưu tiên**\n\n![](https://cdn.bookingcare.vn/fr/w800/2021/07/07/145644-kham-uu-tien-benh-vien-viet-duc.jpg)\n\n5. Bạn vào thẳng phòng khám, nộp phiếu khám, sổ khám bệnh, đọc tên bác sĩ đã đặt hẹn, và báo đã đặt khám qua BookingCare cho nhân viên điều dưỡng tại phòng để được ưu tiên khám.\n', '<h2>GIỚI THIỆU</h2>\n<p><strong>Địa chỉ:</strong>  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</p>\n<ul>\n<li>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội</li>\n</ul>\n<p><strong>Thời gian làm việc:</strong> Thứ 2 đến thứ 7</p>\n<ul>\n<li>Sáng: 7h00 - 12h00</li>\n<li>Chiều: 13h30 - 16h30</li>\n</ul>\n<p>Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p>\n<p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p>\n<p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p>\n<p><strong>Lưu ý quan trọng</strong></p>\n<ul>\n<li>Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.</li>\n<li>Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.</li>\n<li>Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.</li>\n</ul>\n<p><strong>Chi phí khám</strong></p>\n<p>Người bệnh có thể lựa chọn một trong các gói khám sau:</p>\n<ol>\n<li>Gói 1:\n<ul>\n<li>Khám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám</li>\n<li>Khám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám</li>\n</ul>\n</li>\n<li>Gói 2:\n<ul>\n<li>Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám</li>\n</ul>\n</li>\n</ol>\n<h2>THẾ MẠNH CHUYÊN MÔN</h2>\n<p>Bệnh viện Việt Đức là bệnh viện chuyên khoa Ngoại (phẫu thuật), có thế mạnh về khám, điều trị và Phẫu thuật nhiều chuyên khoa. Một số thế mạnh của Bệnh viện Việt Đức là:</p>\n<ul>\n<li>Khám, điều trị, phẫu thuật về Thần kinh</li>\n<li>Khám, điều trị, phẫu thuật về Cơ xương khớp</li>\n<li>Khám, điều trị, phẫu thuật về Cột sống</li>\n<li>Khám, điều trị, phẫu thuật về Tiêu hóa</li>\n<li>Khám, điều trị, phẫu thuật về Gan mật</li>\n<li>Khám, điều trị, phẫu thuật về Nam học</li>\n</ul>\n<p>Là bệnh viện đi đầu về Phẫu thuật ở nước ta, các bác sĩ đã thực hiện thành công rất nhiều ca phẫu thuật khó.</p>\n<ul>\n<li><strong>Phẫu thuật tim mạch:</strong> Mổ tim mở được tiến hành thường quy, tiến hành các kỹ thuật tim mạch khó, thay van tim, kỹ thuật Bentall, bắc cầu mạch vành, mổ nối mạch ở tim đang đập.</li>\n<li><strong>Phẫu thuật Thần kinh:</strong> Mổ chấn thương sọ não, bệnh ở não - tuỷ sống, mổ u tuyến yên qua xoang bướm, mổ u thần kinh VIII qua mê nhĩ có sử dụng dao siêu âm.</li>\n<li><strong>Phẫu thuật Nội soi và nội soi can thiệp:</strong> Các loại phẫu thuật nội soi ổ bụng cắt túi mật, cắt u tuyến thượng thận, cắt dây thần kinh X, u nang buồng trứng, cắt lách, cắt ruột thừa bằng nội soi an toàn, tai biến ít, giảm ngày điều trị, phục hồi sau mổ nhanh.</li>\n<li><strong>Phẫu thuật gan mật tuỵ:</strong> Cắt gan các loại do ung thư, bệnh gan mật và chấn thương; Các phẫu thuật về biến chứng chảy máu do xơ gan - tǎng áp lực tĩnh mạch cửa</li>\n<li><strong>Phẫu thuật Chấn thương chỉnh hình:</strong> Các loại chấn thương, thay khớp háng một bên hay toàn bộ, nội soi khớp.</li>\n<li><strong>Phẫu thuật tiêu hoá:</strong> Các kỹ thuật khó phức tạp như cắt bỏ và tạo hình thực quản, cắt khối tá tuỵ, cắt toàn bộ dạ dày, cắt đại tràng các loại.</li>\n</ul>\n<p><strong>Cụ thể, bệnh viện nhận khám các vấn đề về:</strong></p>\n<ul>\n<li>Bệnh lý thần kinh</li>\n<li>Nội - Hồi sức thần kinh</li>\n<li>Bệnh tim mạch và lồng ngực</li>\n<li>Phẫu thuật tim mạch - lồng ngực</li>\n<li>Ngoại nhi và trẻ sơ sinh</li>\n<li>Bệnh lý tiêu hóa</li>\n<li>Phẫu thuật tiêu hóa</li>\n<li>Bệnh cột sống/thoát vị đĩa đệm</li>\n<li>Chi trên và y học  thể thao</li>\n<li>Bệnh lý chi dưới</li>\n<li>Khám xương và điều trị ngoại trú</li>\n<li>Phẫu thuật chấn thương chung</li>\n<li>Phẫu thuật tạo hình - hàm mặt - thẩm mỹ</li>\n<li>Phục hồi chức năng</li>\n<li>Nhiễm khuẩn</li>\n<li>Phẫu thuật nhiễm khuẩn</li>\n<li>Bệnh đường tiết niệu</li>\n<li>Bệnh nam học/nam khoa</li>\n<li>Bệnh lý gan mật</li>\n<li>Ung bướu</li>\n<li>Thận lọc máu</li>\n<li>Bệnh lý hậu môn trực tràng</li>\n<li>Trung tâm ghép tạng</li>\n<li>Phòng khám Tai mũi họng</li>\n</ul>\n<h2>TRANG THIẾT BỊ</h2>\n<p>Bệnh viện Việt Đức được trang bị hầu hết các trang thiêt bị hiện đại hàng đầu hiện nay phục vụ trong chẩn đoán và thực hiện các xét nghiệm cơ bản, xét nghiệm kỹ thuật cao như các xét nghiệm theo dõi bệnh nhân ghép tạng, các xét nghiệm chỉ điểm khối u.</p>\n<ul>\n<li>Xquang số hóa</li>\n<li>Máy siêu âm</li>\n<li>Máy chụp cắt lớp vi tính đa dãy CT Scan</li>\n<li>Máy chụp cộng hưởng từ MRI 3.0 Tesla</li>\n<li>Hệ thống chụp mạch máy chuyên dụng</li>\n<li>Hệ thống PET/CT phát hiện ung thư sớm và đánh giá các bệnh lý tim mạch, thần kinh</li>\n<li>Hệ thống máy sinh hóa miễn dịch tự động, máy sinh hóa tự động, máy xét nghiệm huyết học, xét nghiệm đông máu tự động…</li>\n</ul>\n<p>Các thiết bị thăm dò chức năng hỗ trợ thăm khám và thực hiện các thủ thuật nội soi tiêu hóa - gan mật.</p>\n<ul>\n<li>Nội soi thực quản - dạ dày - tá tràng chẩn đoán</li>\n<li>Nội soi đại trực tràng chẩn đoán</li>\n<li>Nội soi đường mật - tụy ngược dòng ERCP</li>\n<li>Siêu âm nội soi chẩn đoán bệnh lý thuộc cơ quan tiêu hóa, chọc hút tế bào</li>\n<li>Nội soi can thiệp, nong hẹp đường tiêu hóa</li>\n<li>Nội soi đặt stent khí quản, đặt sonde tá tràng</li>\n<li>Nội soi can thiệp đại tràng.</li>\n</ul>\n<h2>VỊ TRÍ</h2>\n<p>Các trang web khác ghi địa chỉ Bệnh viện Việt Đức ở 40 Tràng Thi, đây là cổng chính nhưng thông thường chỉ dành cho những công việc giấy tờ, hành chính. Bệnh nhân đến khám sẽ đi các cổng phụ trên đường Phủ Doãn.</p>\n<p>Trên đường Phủ Doãn có 3 cổng và đường Tràng Thi có 1 cổng chính. Người bệnh nên đi đúng cổng như chỉ dẫn để đi đến phòng khám dễ dàng, nhanh chóng nhất.</p>\n<p><img src=\"https://cdn.bookingcare.vn/fo/2018/07/04/133335so-do-benh-vien-viet-duc.jpg\" alt=\"\"></p>\n<h2>QUY TRÌNH KHÁM</h2>\n<p>Dưới đây là Hướng dẫn làm thủ tục ưu tiên cho người bệnh đặt khám qua BookingCare tại Bệnh viện Hữu nghị Việt Đức.</p>\n<p><img src=\"https://cdn.bookingcare.vn/fr/w800/2021/07/08/095133-quy-trinh-kham-khu-c4.png\" alt=\"\"></p>\n<p><strong>CỤ THỂ:</strong></p>\n<p><strong>1.</strong> Bạn đến cổng số 16-18 Phủ Doãn</p>\n<p>Về nơi gửi xe:</p>\n<ul>\n<li>Xe máy gửi tại bãi đỗ xe trước cửa bệnh viện (có nhân viên bảo vệ hướng dẫn).</li>\n<li>Xe ô tô: Hiện tại Bệnh viện chưa có chỗ gửi xe ô tô riêng biệt, xe ô tô bạn có thể gửi tại Cung Văn hóa Hữu nghị Việt Xô, cách bệnh viện khoảng 500m. Nếu được, bạn nên đi taxi để thuận tiện hơn.</li>\n</ul>\n<p><img src=\"https://cdn.bookingcare.vn/fo/2018/08/01/114926cong--so--1-benh-vien-viet-duc.jpg\" alt=\"\"></p>\n<ol start=\"2\">\n<li>Bạn đến Tòa nhà C4: Tòa nhà thứ 2 bên tay trái từ cổng vào số 16-18 Phủ Doãn.</li>\n</ol>\n<p><img src=\"https://cdn.bookingcare.vn/fr/w800/2021/07/07/160715-c4-bv-viet-duc.jpg\" alt=\"\"></p>\n<ol start=\"3\">\n<li>Vào tầng 1, xếp hàng ở KHU VỰC ƯU TIÊN DÀNH CHO BỆNH NHÂN KHÁM THEO YÊU CẦU để lấy số ưu tiên nhanh nhất (xem thêm hình dưới).</li>\n</ol>\n<p><img src=\"https://cdn.bookingcare.vn/fr/w800/2020/10/06/154540-c4-quay-uu-tien.jpg\" alt=\"\"></p>\n<ul>\n<li>Đến <strong>quầy số 01</strong>, khi đến lượt vào báo đã Đặt lịch khám qua BOOKINGCARE (phiếu khám đã được in sẵn, người bệnh KHÔNG cần khai báo thêm).</li>\n</ul>\n<p><img src=\"https://cdn.bookingcare.vn/fr/w800/2020/10/06/162248-quay-dang-ki-uu-tien-1.jpg\" alt=\"\"></p>\n<p><strong>4.</strong> Bạn sẽ nhận được phiếu khám <strong>có dán tem ưu tiên</strong></p>\n<p><img src=\"https://cdn.bookingcare.vn/fr/w800/2021/07/07/145644-kham-uu-tien-benh-vien-viet-duc.jpg\" alt=\"\"></p>\n<ol start=\"5\">\n<li>Bạn vào thẳng phòng khám, nộp phiếu khám, sổ khám bệnh, đọc tên bác sĩ đã đặt hẹn, và báo đã đặt khám qua BookingCare cho nhân viên điều dưỡng tại phòng để được ưu tiên khám.</li>\n</ol>\n', , '2023-06-13 01:47:30', '2023-06-13 01:47:30');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionMarkdown`, `descriptionHTML`, `image`, `createdAt`, `updatedAt`) VALUES
(3, '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', 'Bệnh viện Chợ Rẫy', '## GIỚI THIỆU\nBệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.\n\nBệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.\n\n**Địa chỉ bệnh viện:**\n\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh\n\n**Thời gian làm việc:**\n\nBệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:\n* Thứ 2 đến thứ 6: từ 7h – 16h\n* Thứ 7: từ 7h – 11h\n\n**Sơ đồ Bệnh viện Chợ Rẫy**\n\n![](https://cdn.bookingcare.vn/fr/w800/2021/09/14/160246-so-do-bv-rut-gon.jpg)\n\n\n## THẾ MẠNH CHUYÊN MÔN\n**Bệnh viện có 05 Trung tâm**\n1. Trung tâm Ung bướu Chợ Rẫy.\n2. Trung tâm Đào tạo – Chỉ đạo tuyến.\n3. Trung tâm Thông tin thuốc và theo dõi phản ứng thuốc có hại của thuốc khu vực Thành phố HCM.\n4. Trung tâm Truyền máu Chợ Rẫy.\n5. Trung tâm Tim mạch.\n\n**38 Khoa Lâm sàng**\n\n04 Khoa khám bệnh ngoại trú:\n1. Khoa Khám bệnh I\n2. Khoa Khám bệnh II\n3. Khoa Chăm sóc sức khỏe theo yêu cầu.\n4. Khoa Khám xuất cảnh.\n\n34 Khoa lâm sàng.\n\n1. Khoa Phẫu thuật – gây mê hồi sức.\n2. Khoa Hồi sức – phẫu thuật tim.\n3. Khoa Phẫu thuật mạch máu.\n4. Khoa Hồi sức cấp cứu.\n5. Khoa Hồi sức ngoại thần kinh.\n6. Khoa Chấn thương sọ não.\n7. Khoa Ngoại thần kinh (3B1,3B3, Đơn vị Gamma knife).\n8. Khoa Ngoại Tiêu hóa.\n9. Khoa Gan Mật Tụy.\n10. Khoa Ngoại Tiết Niệu.\n11. Khoa Chấn thương chỉnh hình.\n12. Khoa Tai Mũi họng.\n13. Khoa Tạo hình thẩm mỹ.\n14. Khoa Mắt.\n15. Khoa Ngoại lồng ngực.\n16. Khoa Nội tim mạch.\n17. Khoa Tim mạch can thiệp và Đơn vị Nhịp học.\n18. Khoa Nội phổi.\n19. Khoa Nội thận.\n20. Khoa Nội tiêu hóa.\n21. Khoa Nội thần kinh và Đơn vị Thăm dò chức năng thần kinh.\n22. Khoa Nội tổng quát (Lầu 9B1).\n23. Khoa Nội tổng quát – quốc tế (Lầu 10B1).\n24. Khoa Nội tổng quát (Lầu 10B3).\n25. Khoa Điều trị theo yêu cầu (T6).\n26. Khoa Bệnh nhiệt đới và Đơn vị Chống độc.\n27. Khoa Nghiên cứu & điều trị viêm gan.\n28. Khoa Phỏng – tạo hình.\n29. Khoa Nội tiết và Đơn vị Bàn chân đái tháo đường.\n30. Khoa Nội cơ xương khớp.\n31. Khoa Huyết học lâm sàng - Bộ phận Xét nghiệm huyết học và Đơn vị Điều trị trong ngày.\n32. Khoa Cấp cứu.\n33. Khoa Thận nhân tạo.\n34. Khoa Vật lý trị liệu.\n\n**Bệnh viện Chợ Rẫy tổ chức khám và điều trị hầu hết các bệnh lý bằng nội khoa, ngoại khoa, can thiệp,...**\n* Bệnh Thần kinh\n* Bệnh Cơ xương khớp\n* Bệnh tiêu hóa\n* Tim mạch\n* Phổi\n* Thận\n* Gan mật\n* Thận - Tiết niệu\n* Tai Mũi Họng\n* Chấn thương chỉnh hình\n* Mắt\n* Bệnh truyền nhiễm\n* Nội tiết\n* ...\n\n## QUY TRÌNH ĐI KHÁM\nBước 1. Đặt khám qua Nền tảng BookingCare\n* Chọn \"Bệnh viện Chợ Rẫy\"\n* Chọn chuyên khoa khám\n* Đặt khám & làm theo hướng dẫn\n\nBước 2. Đến quầy tiếp nhận tại Khoa khám bệnh\n* Đến tầng trệt nhà A, trước giờ hẹn ít nhất 15 phút (Khoa khám bệnh, Cổng số 01 - Số 201B Nguyễn Chí Thanh) \n* Vào \"Khu nhận bệnh\" (tầng trệt, nhà A) để được hướng dẫn\n\nBước 3. Vào phòng khám gặp bác sĩ khám\n* Lên lầu 1 Khoa khám bệnh (tầng trên, Nhà A)\n* Chờ đến lượt, vào phòng khám đã đăng ký gặp bác sĩ khám\n\n![](https://cdn.bookingcare.vn/fr/w800/2021/09/14/164236-khu-nhan-benh--huong-dan.jpg)\n\n## GIÁ KHÁM BỆNH\n**Chi phí khám thường:**\n* Bệnh nhân không có BHYT: Đóng 38.700 VNĐ/ lượt khám\n* Chi phí khám tại Bệnh viện theo qui định chung của Bộ Y tế\n\n**Một số giấy tờ nên mang theo khi đi khám:**\n* Thẻ bảo hiểm y tế còn hạn sử dụng\n* Chứng minh thư nhân dân hoặc giấy khai sinh (trẻ em)\n* Giấy chuyển viện đến Bệnh viện Chợ Rẫy (nếu có)\n\n\n', '<h2>GIỚI THIỆU</h2>\n<p>Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.</p>\n<p>Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.</p>\n<p><strong>Địa chỉ bệnh viện:</strong></p>\n<p>201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<p>Bệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:</p>\n<ul>\n<li>Thứ 2 đến thứ 6: từ 7h – 16h</li>\n<li>Thứ 7: từ 7h – 11h</li>\n</ul>\n<p><strong>Sơ đồ Bệnh viện Chợ Rẫy</strong></p>\n<p><img src=\"https://cdn.bookingcare.vn/fr/w800/2021/09/14/160246-so-do-bv-rut-gon.jpg\" alt=\"\"></p>\n<h2>THẾ MẠNH CHUYÊN MÔN</h2>\n<p><strong>Bệnh viện có 05 Trung tâm</strong></p>\n<ol>\n<li>Trung tâm Ung bướu Chợ Rẫy.</li>\n<li>Trung tâm Đào tạo – Chỉ đạo tuyến.</li>\n<li>Trung tâm Thông tin thuốc và theo dõi phản ứng thuốc có hại của thuốc khu vực Thành phố HCM.</li>\n<li>Trung tâm Truyền máu Chợ Rẫy.</li>\n<li>Trung tâm Tim mạch.</li>\n</ol>\n<p><strong>38 Khoa Lâm sàng</strong></p>\n<p>04 Khoa khám bệnh ngoại trú:</p>\n<ol>\n<li>Khoa Khám bệnh I</li>\n<li>Khoa Khám bệnh II</li>\n<li>Khoa Chăm sóc sức khỏe theo yêu cầu.</li>\n<li>Khoa Khám xuất cảnh.</li>\n</ol>\n<p>34 Khoa lâm sàng.</p>\n<ol>\n<li>Khoa Phẫu thuật – gây mê hồi sức.</li>\n<li>Khoa Hồi sức – phẫu thuật tim.</li>\n<li>Khoa Phẫu thuật mạch máu.</li>\n<li>Khoa Hồi sức cấp cứu.</li>\n<li>Khoa Hồi sức ngoại thần kinh.</li>\n<li>Khoa Chấn thương sọ não.</li>\n<li>Khoa Ngoại thần kinh (3B1,3B3, Đơn vị Gamma knife).</li>\n<li>Khoa Ngoại Tiêu hóa.</li>\n<li>Khoa Gan Mật Tụy.</li>\n<li>Khoa Ngoại Tiết Niệu.</li>\n<li>Khoa Chấn thương chỉnh hình.</li>\n<li>Khoa Tai Mũi họng.</li>\n<li>Khoa Tạo hình thẩm mỹ.</li>\n<li>Khoa Mắt.</li>\n<li>Khoa Ngoại lồng ngực.</li>\n<li>Khoa Nội tim mạch.</li>\n<li>Khoa Tim mạch can thiệp và Đơn vị Nhịp học.</li>\n<li>Khoa Nội phổi.</li>\n<li>Khoa Nội thận.</li>\n<li>Khoa Nội tiêu hóa.</li>\n<li>Khoa Nội thần kinh và Đơn vị Thăm dò chức năng thần kinh.</li>\n<li>Khoa Nội tổng quát (Lầu 9B1).</li>\n<li>Khoa Nội tổng quát – quốc tế (Lầu 10B1).</li>\n<li>Khoa Nội tổng quát (Lầu 10B3).</li>\n<li>Khoa Điều trị theo yêu cầu (T6).</li>\n<li>Khoa Bệnh nhiệt đới và Đơn vị Chống độc.</li>\n<li>Khoa Nghiên cứu &amp; điều trị viêm gan.</li>\n<li>Khoa Phỏng – tạo hình.</li>\n<li>Khoa Nội tiết và Đơn vị Bàn chân đái tháo đường.</li>\n<li>Khoa Nội cơ xương khớp.</li>\n<li>Khoa Huyết học lâm sàng - Bộ phận Xét nghiệm huyết học và Đơn vị Điều trị trong ngày.</li>\n<li>Khoa Cấp cứu.</li>\n<li>Khoa Thận nhân tạo.</li>\n<li>Khoa Vật lý trị liệu.</li>\n</ol>\n<p><strong>Bệnh viện Chợ Rẫy tổ chức khám và điều trị hầu hết các bệnh lý bằng nội khoa, ngoại khoa, can thiệp,...</strong></p>\n<ul>\n<li>Bệnh Thần kinh</li>\n<li>Bệnh Cơ xương khớp</li>\n<li>Bệnh tiêu hóa</li>\n<li>Tim mạch</li>\n<li>Phổi</li>\n<li>Thận</li>\n<li>Gan mật</li>\n<li>Thận - Tiết niệu</li>\n<li>Tai Mũi Họng</li>\n<li>Chấn thương chỉnh hình</li>\n<li>Mắt</li>\n<li>Bệnh truyền nhiễm</li>\n<li>Nội tiết</li>\n<li>...</li>\n</ul>\n<h2>QUY TRÌNH ĐI KHÁM</h2>\n<p>Bước 1. Đặt khám qua Nền tảng BookingCare</p>\n<ul>\n<li>Chọn &quot;Bệnh viện Chợ Rẫy&quot;</li>\n<li>Chọn chuyên khoa khám</li>\n<li>Đặt khám &amp; làm theo hướng dẫn</li>\n</ul>\n<p>Bước 2. Đến quầy tiếp nhận tại Khoa khám bệnh</p>\n<ul>\n<li>Đến tầng trệt nhà A, trước giờ hẹn ít nhất 15 phút (Khoa khám bệnh, Cổng số 01 - Số 201B Nguyễn Chí Thanh)</li>\n<li>Vào &quot;Khu nhận bệnh&quot; (tầng trệt, nhà A) để được hướng dẫn</li>\n</ul>\n<p>Bước 3. Vào phòng khám gặp bác sĩ khám</p>\n<ul>\n<li>Lên lầu 1 Khoa khám bệnh (tầng trên, Nhà A)</li>\n<li>Chờ đến lượt, vào phòng khám đã đăng ký gặp bác sĩ khám</li>\n</ul>\n<p><img src=\"https://cdn.bookingcare.vn/fr/w800/2021/09/14/164236-khu-nhan-benh--huong-dan.jpg\" alt=\"\"></p>\n<h2>GIÁ KHÁM BỆNH</h2>\n<p><strong>Chi phí khám thường:</strong></p>\n<ul>\n<li>Bệnh nhân không có BHYT: Đóng 38.700 VNĐ/ lượt khám</li>\n<li>Chi phí khám tại Bệnh viện theo qui định chung của Bộ Y tế</li>\n</ul>\n<p><strong>Một số giấy tờ nên mang theo khi đi khám:</strong></p>\n<ul>\n<li>Thẻ bảo hiểm y tế còn hạn sử dụng</li>\n<li>Chứng minh thư nhân dân hoặc giấy khai sinh (trẻ em)</li>\n<li>Giấy chuyển viện đến Bệnh viện Chợ Rẫy (nếu có)</li>\n</ul>\n', , '2023-06-13 01:59:08', '2023-06-13 01:59:08');

